module.exports = " <!-- start page-title -->\n <section class=\"page-title\">\n  <div class=\"container\">\n      <div class=\"row\">\n          <div class=\"col col-xs-12\">\n              <h2>Purchases</h2>\n              <ol class=\"breadcrumb\">\n                <li><a [routerLink]=\"['/']\">Home</a></li>\n                <li>Purchases</li>\n              </ol>\n          </div>\n      </div> <!-- end row -->\n  </div> <!-- end container -->\n</section>        \n<!-- end page-title -->\n\n\n<!-- start service-single-section -->\n<section class=\"service-single-section section-padding\">\n  <div class=\"container\">\n      <div class=\"row\">\n          <div class=\"col col-md-8 col-md-push-4\">\n              <div class=\"service-single-content\">\n<!--                         <h3>What Do You Mean By GST Registration?</h3>\n-->                        <p>ERP Purchase helps you to manage various vendors, supplier’s contacts; you can track your purchases, and also get the entire purchase history, etc. It records the purchase requests, orders, returns, various suppliers, etc. which enables you to know the product delivery time, quality, cost, etc. ERP Purchase automates the process to identify the various suppliers, purchase order to the supplier, price, as well as billing process.  </p>\n                  <div class=\"img-holder\">\n                      <img src=\"assets/images/erp-purchases.png\" alt>\n                  </div>\n                  <br><br>\n<p>From our GstGola, you are allowed to check the statistics of the supplier’s performance through their reporting like discounts given on the products, quantities purchased, delivery delays, etc. And from here, you can make the sales orders, share products, supplier’s customers, and also maintain the invoices for companies.</p>               \n<p>ERP is a leading business which helps you to handle the deliveries and that allows you to track the items of your purchase. GstGola also gives the price list of the items, so that you can make your decision smarter. Our integrated purchase management solution gives you the simplified interface to make the best decisions on purchase.</p>\n                  <div class=\"discussion-faq\">\n                      <div class=\"discussion\">\n                            <h4>Purchase Reports and Invoice</h4>\n                  <p>The invoice must be created to purchase goods. To make the invoice, you need to enter your general details, order details, billing details, etc. of the product.</p>\n                  <ul>\n                        <li><i class=\"fa fa-adjust\"></i>  Invoices of the supplier are very simple to enter from the existing purchase.</li>\n                        <li><i class=\"fa fa-adjust\"></i>  Each and every screen is broken into two different tabs which show items and expenses.</li>\n                        <li><i class=\"fa fa-adjust\"></i>  Items tab shows only the items of the user and the expenses tab shows only expenses of the user.</li>\n                        <li><i class=\"fa fa-adjust\"></i>  Line items will be classified and expensed to the projects according to the need of the project.</li>\n                      \n                  </ul>\n                      </div>\n\n                     <!--  <div class=\"faq\">\n                          <div class=\"panel-group\" id=\"accordion\">\n                              <div class=\"panel panel-default\">\n                                  <div class=\"panel-heading\">\n                                      <a data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-1\" aria-expanded=\"true\"> Who are exempted from the GST Registration ? </a>\n                                  </div>\n                                  <div id=\"collapse-1\" class=\"panel-collapse collapse in\">\n                                      <div class=\"panel-body\">\n                                          <p>The GST Registration is not mandatory for the people like:</p>\n                                \n                                                <div class=\"discussion faq-list\">   \n                                            <ul>\n                                                        <li><i class=\"fa fa-adjust\"></i>Who supply agriculture products from the cultivation. </li>\n                                                        <li><i class=\"fa fa-adjust\"></i>Makes non-taxable supply of goods and services.</li>\n                                                        <li><i class=\"fa fa-adjust\"></i>Making supplies under the reverse charge mechanism</li>\n\n                                                </ul>\n                                                </div>\n                                            \n                                      </div>\n                                  </div>\n                              </div>\n\n                              <div class=\"panel panel-default\">\n                                  <div class=\"panel-heading\">\n                                      <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-2\">Who is a casual taxable person ?</a>\n                                  </div>\n                                  <div id=\"collapse-2\" class=\"panel-collapse collapse\">\n                                      <div class=\"panel-body\">\n                                          <p>Persons who have registered the business in India and having the supplies from other states in India without a fixed place of business, Such persons are known as Casual Taxable Persons.</p>\n                                      </div>\n                                  </div>\n                              </div>\n\n                              <div class=\"panel panel-default\">\n                                  <div class=\"panel-heading\">\n                                      <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-3\">What do you mean by ARN in GST Registration ?</a>\n                                  </div>\n                                  <div id=\"collapse-3\" class=\"panel-collapse collapse\">\n                                      <div class=\"panel-body\">\n                                          <p>ARN refers to the Application Reference Number which is proof after the submission of the application to the GST servers. And this is generated by the Temporary Reference Number (TRN) and uploading of the documents.</p>\n                                      </div>\n                                  </div>\n                              </div>\n\n                              <div class=\"panel panel-default\">\n                                    <div class=\"panel-heading\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-4\">Can we register for GST voluntarily ?</a>\n                                    </div>\n                                    <div id=\"collapse-4\" class=\"panel-collapse collapse\">\n                                        <div class=\"panel-body\">\n                                            <p>Yes, entities claiming the input tax credit can register voluntarily, even if it is not liable to register.</p>\n                                        </div>\n                                    </div>\n                                </div>\n\n                                <div class=\"panel panel-default\">\n                                        <div class=\"panel-heading\">\n                                            <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-5\">Registration granted for any person is permanent or not ?</a>\n                                        </div>\n                                        <div id=\"collapse-5\" class=\"panel-collapse collapse\">\n                                            <div class=\"panel-body\">\n                                                <p>Once the registration is granted, it is permanent unless it is canceled, suspended.</p>\n                                            </div>\n                                        </div>\n                                    </div>\n                          </div>\n                      </div> --> <!-- end faq -->\n                  </div> <!-- end discusssion-faq -->\n              </div> <!-- end service-single-content -->\n          </div> <!-- end col -->\n          <div class=\"col col-md-4 col-md-pull-8\">\n              <div class=\"service-sidebar\">\n                  <div class=\"widget link-widget\">\n                      <ul>\n                          <li><a [routerLink]=\"['/ERP']\" >All ERP Services</a></li>\n                          <li class=\"active\"><a [routerLink]=\"['/ERP-Purchases']\">Purchases</a></li>\n                          <li ><a [routerLink]=\"['/ERP-Products']\">Products </a></li>\n\n                          <li><a [routerLink]=\"['/ERP-Sales']\">Sales</a></li>\n                          <li><a [routerLink]=\"['/ERP-Assets']\">Assets and Liabilities</a></li>\n                          <li ><a [routerLink]=\"['/bank']\">Bank Transactions</a></li>\n                          <li><a [routerLink]=\"['/ERP-Profit-Loss']\">Profit and Loss</a></li>\n                          <li><a [routerLink]=\"['/ERP-Expenses']\">Expenses</a></li>\n                          <li><a [routerLink]=\"['/ERP-User-Management']\">User management</a></li>\n                          <li><a [routerLink]=\"['/ERP-Vendor-Management']\">Vendor Management</a></li>\n\n\n\n                        </ul>\n                  </div>\n                 \n                  <div class=\"widget brochures-widget\">\n                      <h3>Brochures</h3>\n                      <p>View our 2017 financial prospectus brochure for an easy to read guide on all of the services offer.</p>\n                      <div class=\"btns\">\n                          <a href=\"#\"><i class=\"fa fa-download\"></i> Download Brochure</a>\n                   </div>\n                  </div>\n\n                  <div class=\"widget contact-widget\">\n                    <h3>Contact</h3>\n                    <ul>\n                        <li><i class=\"fa fa-location-arrow\"></i> 3111 West Allegheny Avenue Pennsylvania 19132</li>\n                        <li><i class=\"fa fa-phone\"></i> 1-982-782-5297 <br>1-982-125-6378</li>\n                        <li><i class=\"fa fa-envelope\"></i> support@top-finance.com</li>\n                    </ul>\n                </div>\n             \n                </div>\n\n          </div>\n      </div> <!-- end row -->\n  </div> <!-- end container -->\n</section>\n<!-- end service-single-section -->\n\n\n"

