module.exports = "\n        <!-- start page-title -->\n        <section class=\"page-title\">\n          <div class=\"container\">\n              <div class=\"row\">\n                  <div class=\"col col-xs-12\">\n                      <h2>About us</h2>\n                      <ol class=\"breadcrumb\">\n                        <li><a [routerLink]=\"['/']\">Home</a></li>\n                        <li>About us</li>\n                      </ol>\n                  </div>\n              </div> <!-- end row -->\n          </div> <!-- end container -->\n      </section>        \n      <!-- end page-title -->\n\n\n      <!-- start about-section -->\n      <section class=\"section-padding about-section-s5\">\n          <div class=\"container\">\n              <div class=\"row\">\n                  <div class=\"col col-lg-8 col-md-10\">\n                      <div class=\"section-title-s2\">\n                          <h2>Our GSTgola goal is to make customers feel they’re secured</h2>\n                      </div>\n                  </div>\n              </div>\n              <div class=\"row\">\n                  <div class=\"col col-md-7\">\n                      <div class=\"about-details\">\n                          <p>GstGola is the best GST Software providing website for the enterprises which helps out in almost everything related to the GST compliance. These days GST has a great impact on each and every business irrespective of the sectors. GstGola is the perfect place where you can have a complete understanding about the GST services, GST returns, GST Invoice, Transition to GST and  a lot more. It is the right place for you where you can freely download the GST software both for Accounting and Filling purpose. We work as a team to deliver the feasible solutions to our clients. With our team efforts, we provide the value added services to the customers with innovative solutions. GstGola has achieved its rank in today's GST world where it delivers the successful GST services to its clients in an effective way.\n                        </p>\n                          <h3>Right Now</h3>\n                          <p>GstGola has the professional team with tax accounts and tax filing. We have understood that there are a lot of complications in the present GST system. So we have come with the latest software which overcomes all the issues and finds out the best solutions to your problems as well. The main motto of the GstGola is to help out everyone who is facing the difficulty with GST taxes, accounts which involves technical provisions for the new GST system. It is designed to configure the dynamic GST rules and a separate database which is secured.\n                            Finally, GstGola is the best choice for the people who are looking for the GST software and its feasibleness in filing and accounting sections. </p>\n<p>GstGola has a unique place in the business world to deliver the best GST solutions to its clients. And the experts in the GstGola research for the new and upcoming events in the GST environment and hence deliver the creative solutions for GST. This GstGola platform allows the customers or clients to get ready for the GST rollouts and the changes in the GST for the upcoming years. The success story of the GstGola lies behind the creative solutions, products and services and its targets to meet the needs of the customers.</p>                      </div>\n\n</div>\n\n                  <div class=\"col col-md-5\">\n                      <div class=\"about-img\">\n                          <img src=\"assets/images/aboutus.jpg\" alt=\"\">\n                      </div>\n                  </div>\n              </div>\n          </div> <!-- end container -->\n      </section>        \n      <!-- end about-section -->        \n\n      <app-contact></app-contact>\n\n\n<!-- start testimonials-section -->\n<section class=\"testimonials-section section-padding\">\n  <div class=\"container\">\n      <div class=\"row\">\n          <div class=\"col col-xs-12\">\n              <div class=\"section-title\">\n                  <h2>Testimonials</h2>\n              </div>\n          </div>\n      </div>\n      <div class=\"row\">\n          <div class=\"col col-lg-10 col-lg-offset-1\">\n              <div class=\"testimonials-slider testimonials-grids\">\n                  <div class=\"grid\">\n                      <div class=\"client-pic\">\n                          <img src=\"assets/images/user1.png\" alt>\n                      </div>\n                      <div class=\"details\">\n                          <h4>Monica Hall</h4>\n                          <span class=\"client-post\">CEO, Bream-Hall Partners</span>\n                          <p>After experiencing with many accounting softwares, I have chosen the GstGola.com, which is the perfect site for simple taxation. It is an excellent assistance GST service provider. </p>\n                      </div>\n                  </div>\n                  <div class=\"grid\">\n                      <div class=\"client-pic\">\n                          <img src=\"assets/images/user1.png\" alt>\n                      </div>\n                      <div class=\"details\">\n                          <h4>Jared Dunn</h4>\n                          <span class=\"client-post\">CEO, Bream-Hall Partners</span>\n                          <p>There is no complexity in GST with the help of GstGola. GstGola provides the best software with the booming technology. My experience with GstGola is well that it is time-effective, simple and free from errors. </p>\n                      </div>\n                  </div>\n                  <div class=\"grid\">\n                      <div class=\"client-pic\">\n                          <img src=\"assets/images/user1.png\" alt>\n                      </div>\n                      <div class=\"details\">\n                          <h4>Richard Henrics</h4>\n                          <span class=\"client-post\">CEO, Bream-Hall Partners</span>\n                          <p>GstGola has got an incredible team in solving issues within minutes. This is an added advantage to my business.  I have been a part of GstGola for the past one year which hindrances from the tax burdens.</p>\n                      </div>\n                  </div>\n\n                  <div class=\"grid\">\n                        <div class=\"client-pic\">\n                            <img src=\"assets/images/user1.png\" alt>\n                        </div>\n                        <div class=\"details\">\n                            <h4>Karen Murphy</h4>\n                            <span class=\"client-post\">CEO, Bream-Hall Partners</span>\n                            <p>I am thankful to GstGola that all my problems with the Goods and Services tax have been solved. Happy to be with GstGola.com. My suggestion be a part of GstGola to be free from tax burdens.</p>\n                        </div>\n                    </div>\n              </div>\n          </div>\n      </div>\n  </div> <!-- end container -->\n</section>\n<!-- end testimonials-section -->\n\n"

