module.exports = "\n\n\n        <!-- start page-title -->\n        <section class=\"page-title\">\n            <div class=\"container\">\n                <div class=\"row\">\n                    <div class=\"col col-xs-12\">\n                        <h2>Services</h2>\n                        <ol class=\"breadcrumb\">\n                            <li><a [routerLink]=\"['/']\">Home</a></li>\n                            <li>Services</li>\n                        </ol>\n                    </div>\n                </div> <!-- end row -->\n            </div> <!-- end container -->\n        </section>        \n        <!-- end page-title -->\n\n\n        <!-- start services-pg-section -->\n        <section class=\"services-pg-section section-padding\">\n            <div class=\"container\">\n                <div class=\"row\">\n                    <div class=\"col col-xs-12\">\n                        <div class=\"services-grid-s2\">\n                            <div class=\"grid\">\n                                <div class=\"icon\">\n                                   <img src=\"assets/svg-icons/gst-register.svg\" class=\"svi\"  alt=\"gst-registration\">\n                                </div>\n                                <div class=\"details\">\n                                    <h3>GST Registration</h3>\n                                    <p>GST is the Goods and Service Tax which includes all the taxes like Sales tax, Excise Duty tax, Service tax, etc. Under the GST regime, the business whose turnover is more than Rs.20 lakhs must register under GST.</p>\n                                    <a [routerLink]=\"['/GST-Registration']\" class=\"read-more\">Read More</a>\n                                </div>\n                               \n                                <div class=\"hover-grid\">\n                                    <span></span>\n                                    <span></span>\n                                    <span></span>\n                                </div>\n                            </div>\n                            <div class=\"grid\">\n                                <div class=\"icon\">\n                                        <img src=\"assets/svg-icons/gst-return-filling.svg\" class=\"svi\"  alt=\"gst-return-filling\">\n\n                                </div>\n                                <div class=\"details\">\n                                    <h3>GST Return Filing</h3>\n                                    <p>GST Returns are must file by the users who have registered under GST. Goods and Services Tax simplifies the indirect tax system in India. GST Returns are must be filed by the tax person even if zero takes place. </p>\n                                    <a [routerLink]=\"['/GST-Retrurn-Filling']\"  class=\"read-more\">Read More</a>\n                                </div>\n                                <div class=\"hover-grid\">\n                                    <span></span>\n                                    <span></span>\n                                    <span></span>\n                                </div>\n                            </div>\n                            <div class=\"grid\">\n                                <div class=\"icon\">\n                                        <img src=\"assets/svg-icons/gst-migrate.svg\" class=\"svi\"  alt=\"gst-migration\">\n\n                                </div>\n                                <div class=\"details\">\n                                    <h3>GST Migration</h3>\n                                    <p>GST Migration is the process of enrolling for the existing indirect tax assessees. (assessees in the sense VAT Service tax and Central Excise.) GST Migration is important for a firm or an individual whose annual income is more than Rs. 20 Lakhs.\n                                    </p>\n                                    <a [routerLink]=\"['/GST-Migration']\" class=\"read-more\">Read More</a>\n                                </div>\n                                <div class=\"hover-grid\">\n                                    <span></span>\n                                    <span></span>\n                                    <span></span>\n                                </div>\n                            </div>\n                            <div class=\"grid\">\n                                <div class=\"icon\">\n                                        <img src=\"assets/svg-icons/gst-software-tool.svg\" class=\"svi\"  alt=\"gst-software-tool\">\n                                </div>\n                                <div class=\"details\">\n                                    <h3>GST Software and Tool</h3>\n                                    <p>GST Software is the backbone for smooth GST and clear operations that provides the need for its users. And for easy management of different business process this GST Accounting Software will be helpful to you. GstGola offers the GST Software & Tool that allows you to control all your business needs. </p>\n                                    <a [routerLink]=\"['/GST-Software']\" class=\"read-more\">Read More</a>\n                                </div>\n                                                               \n                                <div class=\"hover-grid\">\n                                    <span></span>\n                                    <span></span>\n                                    <span></span>\n                                </div>\n                            </div>\n                            <div class=\"grid\">\n                                <div class=\"icon\">\n                                        <img src=\"assets/svg-icons/gst-assessment.svg\" class=\"svi\"  alt=\"gst-assessment\">\n                                </div>\n                                <div class=\"details\">\n                                    <h3>GST Assessment</h3>\n                                    <p>GST Assessment is required for establishing the tax liability of a taxpayer. Assessment is the process of determining the tax liability of the assessee. Under the GST law, there are different ways for the GST Assessment. Taxation Laws are the way to get to know how much exactly the tax should be paid. </p>\n                                    <a [routerLink]=\"['/GST-Assessment']\" class=\"read-more\">Read More</a>\n                                </div>\n                                <div class=\"hover-grid\">\n                                    <span></span>\n                                    <span></span>\n                                    <span></span>\n                                </div>\n                            </div>\n                            <div class=\"grid\">\n                                <div class=\"icon\">\n                                        <img src=\"assets/svg-icons/gsp-asp.svg\" class=\"svi\"  alt=\"gsp-asp-service-provider\">\n\n                                </div>\n                                <div class=\"details\">\n                                    <h3>GSP and ASP Service Provider</h3>\n                                    <p>Goods and Service Tax Network (GSTN) has approved our GstGola in ASP of GSP. GSTN allows the approved GSPs under the Goods and Service Tax Network to connect the GSTN using the published APIs. GstGola has the best team to solve all the needs of taxpayers.\n                                    </p>\n                                    <a [routerLink]=\"['/GST-Service-Provider']\" class=\"read-more\">Read More</a>\n                                </div>\n                                <div class=\"hover-grid\">\n                                    <span></span>\n                                    <span></span>\n                                    <span></span>\n                                </div>\n                            </div>\n                        </div>\n                    </div>\n                </div>\n            </div> <!-- end container -->\n        </section>\n        <!-- end services-pg-section -->\n\n\n        \n       \n<!-- <app-footer-top></app-footer-top>\n<app-footer-copyright></app-footer-copyright> -->"

