module.exports = " <!-- start page-title -->\n <section class=\"page-title\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col col-xs-12\">\n                <h2>GST Assessment</h2>\n                <ol class=\"breadcrumb\">\n                    <li><a [routerLink]=\"['/']\">Home</a></li>\n                    <li>GST Assessment</li>\n                </ol>\n            </div>\n        </div> <!-- end row -->\n    </div> <!-- end container -->\n  </section>        \n  <!-- end page-title -->\n  \n  \n  <!-- start service-single-section -->\n  <section class=\"service-single-section section-padding\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col col-md-8 col-md-push-4\">\n                <div class=\"service-single-content\">\n                  <h4>Get to Know About GST Assessments</h4>\n                  <p>The Goods and Service tax combines all the indirect taxes under one tree and makes the business globally competitive. Taxation Laws are the way to get to know how much exactly the tax should be paid. </p>\n                  \n                  <p>Basically, there are two types of assessments. </p>\n\n                  <div class=\"discussion\">\n\n                  <ul class=\"ull\">\n                      <li><i class=\"fa fa-adjust\"></i> Assessments by a taxable person.</li>\n                      <li><i class=\"fa fa-adjust\"></i> Assessments by the tax authorities.</li>\n                  </ul>\n</div>\n                    \n                  <div class=\"img-holder\">\n                            <img src=\"assets/images/gst-assessment.PNG\" alt=\"\">     \n                        </div>\n                    <br><br>\n                 \n  \n                    <div class=\"discussion-v\">\n                                    <div class=\"discussion\">\n                                          <h4>Different Types of Tax Assessments</h4>\n                                     <ul>\n                                      <li><i class=\"fa fa-adjust\"></i>  <strong>Self Assessment:</strong> The registered tax payers must assess the tax on their own and provide the returns for the tax period.</li>\n                                      <li><i class=\"fa fa-adjust\"></i>  <strong>Provisional Assessment:</strong> This Provisional Assessment will be conducted based on the following circumstances.\n                                        <ul class=\"ull\">\n                                            <li> i. When the taxpayer is unable to determine the goods and services.</li>\n                                            <li> ii. When he is unable to regulate the tax which is applicable to both the goods and services.</li>\n                                        </ul>\n                                     </li>\n                                     <li><i class=\"fa fa-adjust\"></i><strong>Scrutiny Assessment:</strong> And this assessment is done to verify the correctness of the information available on the returns.</li>\n                                     <li><i class=\"fa fa-adjust\"></i><strong>Summary Assessment:</strong> Both the Summary and Regular Assessments are similar to each other. The assessing officer passes the summary assessment in prior to the additional/joint commissioner.\n                                     </li>\n            \n            \n                                     <li><i class=\"fa fa-adjust\"></i>  <strong>Best Judgement Assessment:</strong>\n                                        <ul class=\"ull\">\n                                            <li> i. <strong>Assessment of Non-filer Returns:</strong> If the registered taxpayers do not file his returns even after the notice, then the related officer will assess the tax liability to the best of his Judgement.</li>\n                                            <li>ii. <strong>Assessment of Unregistered Persons:</strong> This comes into picture when the taxpayer fails to register even though he is supposed to do.</li>\n                                        </ul>\n                                     </li>\n            \n                                    </ul>\n                                    </div>\n                    </div>\n  \n                    <div class=\"discussion-faq\">\n                            <div class=\"discussion\">\n                            <h4>Advance Ruling</h4>\n<!--                             <p>Taxpayers are responsible for registering under the GST System. Therefore the individuals registered with the following authorities are eligible for the GST Migration process.</p>\n -->                            <ul>\n                                  <li><i class=\"fa fa-adjust\"></i>  The Advance ruling is the written interpretation of the tax laws. </li>\n                                  <li><i class=\"fa fa-adjust\"></i>  This Advance ruling is the tax authority for the corporations and individuals regarding the tax matters.</li>\n                                  <li><i class=\"fa fa-adjust\"></i>  According to GST, the advance ruling is the applicants based on the questions related to the Goods and Services. </li>\n                                  <li><i class=\"fa fa-adjust\"></i>  And the advance ruling is applicable, before the start of the proposed activity. An Advance ruling will be sent to the first authority. </li>\n                                  <li><i class=\"fa fa-adjust\"></i>  Any person who is not satisfied with the advance ruling can appeal to the Appellate authority for the advance ruling. </li>\n                                  <li><i class=\"fa fa-adjust\"></i>  GST has the provision for the taxpayers to request for the clarifications from the authorities on a particular tax-related matter or any proposed activity.</li>\n                                  \n                            </ul>\n                                </div>\n                        \n  \n                        <div class=\"faq\">\n                            <div class=\"panel-group\" id=\"accordion\">\n                                <div class=\"panel panel-default\">\n                                    <div class=\"panel-heading\">\n                                        <a data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-1\" aria-expanded=\"true\">Who are all responsible for making an assessment of tax payable under the Act ? </a>\n                                    </div>\n                                    <div id=\"collapse-1\" class=\"panel-collapse collapse in\">\n                                        <div class=\"panel-body\">\n                                                <p>Individuals registered under the GST must assess the tax payable by him/her. And after this assessment, they can file the returns required under this Act.</p>                                                 \n                                        </div>\n                                    </div>\n                                </div>\n  \n                                <div class=\"panel panel-default\">\n                                    <div class=\"panel-heading\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-2\">What is the limited time for passing the assessment order under section 46 and 47 ?</a>\n                                    </div>\n                                    <div id=\"collapse-2\" class=\"panel-collapse collapse\">\n                                        <div class=\"panel-body\">\n                                            <p>The time limit is three or five years right from the due date of filing the annual returns.</p>\n                                        </div>\n                                    </div>\n                                </div>\n  \n                                <div class=\"panel panel-default\">\n                                    <div class=\"panel-heading\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-3\"> What is the duration for the completion of the audits ?</a>\n                                    </div>\n                                    <div id=\"collapse-3\" class=\"panel-collapse collapse\">\n                                        <div class=\"panel-body\">\n                                            <p>The audit must have to complete within three months from the audit commencement. Later this time period has been extended to six months by the commissioner. </p>\n                                        </div>\n                                    </div>\n                                </div>\n  \n                                <div class=\"panel panel-default\">\n                                      <div class=\"panel-heading\">\n                                          <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-4\">Who serves the notice for the special audit ?</a>\n                                      </div>\n                                      <div id=\"collapse-4\" class=\"panel-collapse collapse\">\n                                          <div class=\"panel-body\">\n                                              <p>A Chartered Account or the Cost Accountant who is nominated by the Commissioner will serve the notice for the special audit.</p>\n                                          </div>\n                                      </div>\n                                  </div>\n  \n                                  <div class=\"panel panel-default\">\n                                          <div class=\"panel-heading\">\n                                              <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-5\">Who bears the cost of the special audit ?</a>\n                                          </div>\n                                          <div id=\"collapse-5\" class=\"panel-collapse collapse\">\n                                              <div class=\"panel-body\">\n                                                  <p>The borne of the Commissioner determines the expenses for audits and the examinations including the remuneration payable to the auditor.</p>\n                                              </div>\n                                          </div>\n                                      </div> \n                            </div>\n                        </div> <!-- end faq -->\n                    </div> <!-- end discusssion-faq -->\n                </div> <!-- end service-single-content -->\n            </div> <!-- end col -->\n            <div class=\"col col-md-4 col-md-pull-8\">\n                <div class=\"service-sidebar\">\n                    <div class=\"widget link-widget\">\n                        <ul>\n                            <li><a [routerLink]=\"['/services']\" >All Services</a></li>\n                            <li ><a [routerLink]=\"['/GST-Registration']\">GST Registration </a></li>\n                            <li><a [routerLink]=\"['/GST-Retrurn-Filling']\">GST Return Filing</a></li>\n                            <li ><a [routerLink]=\"['/GST-Migration']\">GST Migration</a></li>\n                            <li ><a [routerLink]=\"['/GST-Software']\">GST Software And Tool</a></li>\n                            <li class=\"active\"><a [routerLink]=\"['/GST-Assessment']\">GST Assessment</a></li>\n                            <li><a [routerLink]=\"['/GST-Service-Provider']\">GSP And ASP Service Provider</a></li>\n                        </ul>\n                    </div>\n                    \n                    <div class=\"widget brochures-widget\">\n                        <h3>Brochures</h3>\n                        <p>View our 2017 financial prospectus brochure for an easy to read guide on all of the services offer.</p>\n                        <div class=\"btns\">\n                            <a href=\"#\"><i class=\"fa fa-download\"></i> Download Brochure</a>\n                     </div>\n                    </div>\n\n                    <div class=\"widget contact-widget\">\n                        <h3>Contact</h3>\n                        <ul>\n                            <li><i class=\"fa fa-location-arrow\"></i> 3111 West Allegheny Avenue Pennsylvania 19132</li>\n                            <li><i class=\"fa fa-phone\"></i> 1-982-782-5297 <br>1-982-125-6378</li>\n                            <li><i class=\"fa fa-envelope\"></i> support@top-finance.com</li>\n                        </ul>\n                    </div>\n                </div>\n            </div>\n        </div> <!-- end row -->\n    </div> <!-- end container -->\n  </section>\n  <!-- end service-single-section -->\n  \n  \n  "

