module.exports = " <!-- start page-title -->\n <section class=\"page-title\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col col-xs-12\">\n                <h2>GST Migration</h2>\n                <ol class=\"breadcrumb\">\n                    <li><a [routerLink]=\"['/']\">Home</a></li>\n                    <li>GST Migration</li>\n                </ol>\n            </div>\n        </div> <!-- end row -->\n    </div> <!-- end container -->\n  </section>        \n  <!-- end page-title -->\n  \n  \n  <!-- start service-single-section -->\n  <section class=\"service-single-section section-padding\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col col-md-8 col-md-push-4\">\n                <div class=\"service-single-content\">\n                    <h4>Easy GST Migration Process</h4>\n                    <p>Have you not yet migrated to GST? Then do it right now.\n                         GST Migration is the first step to complete by the every business owner. \n                         The existing taxpayers must soon register under GST. \n                         Individual taxpayers registered under VAT/Service/Tax must enroll on the common portal by validating the email address, mobile number. Or else by directly through facilitation center which is notified by the commissioner. On completion of the provisional registration, the provisional\\\n                         registration must be converted into final registration.</p>\n                   \n                    <div class=\"img-holder\">\n                            <img src=\"assets/images/gst-migration.png\" alt=\"\">     \n                        </div>\n                    <br>\n                 \n  \n                    <div class=\"discussion-v\">\n                          <div class=\"discussion\">\n                    <h4>Steps for GST Migration Process</h4>\n                    <p>To Migrate to GST, the individual taxpayers must have to follow the below migration steps.</p>\n                    <ul>\n                        <li><i class=\"fa fa-adjust\"></i> Firstly create the user ID and password on the common portal.</li>\n                        <li><i class=\"fa fa-adjust\"></i> Enter your business details.</li>\n                        <li><i class=\"fa fa-adjust\"></i> Enter the details of the Proprietor, Manager, Director, and Partner.</li>\n                        <li><i class=\"fa fa-adjust\"></i> Fill the details of the Authorized Signature.</li>\n                        <li><i class=\"fa fa-adjust\"></i> Details of the Principal Place of Business, Additional Place of Business.</li>\n                        <li><i class=\"fa fa-adjust\"></i> Enter the details of the Supplied Goods and Services.</li>\n                        <li><i class=\"fa fa-adjust\"></i> Also, enter the Bank Account details.</li>\n                        <li><i class=\"fa fa-adjust\"></i> And the last step is the final verification.</li>\n  \n  \n                    </ul>\n                    </div></div>\n  \n                    <div class=\"discussion-faq\">\n                        <div class=\"discussion\">\n                              <h4>Eligibility for Migration to GST</h4>\n                    <p>Taxpayers are responsible for registering under the GST System. Therefore the individuals registered with the following authorities are eligible for the GST Migration process.</p>\n                    <ul>\n                          <li><i class=\"fa fa-adjust\"></i>  VAT</li>\n                          <li><i class=\"fa fa-adjust\"></i>  Service Tax</li>\n                          <li><i class=\"fa fa-adjust\"></i>  Central Excise</li>\n                          <li><i class=\"fa fa-adjust\"></i>  Entertainment Tax</li>\n                          <li><i class=\"fa fa-adjust\"></i>  Luxury Tax</li>\n                          <li><i class=\"fa fa-adjust\"></i>  Entry Tax</li>\n                          \n                    </ul>\n                        </div>\n  \n                        <div class=\"faq\">\n                            <div class=\"panel-group\" id=\"accordion\">\n                                <div class=\"panel panel-default\">\n                                    <div class=\"panel-heading\">\n                                        <a data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-1\" aria-expanded=\"true\"> Is GST Migration and Registration is different in case of GST ? </a>\n                                    </div>\n                                    <div id=\"collapse-1\" class=\"panel-collapse collapse in\">\n                                        <div class=\"panel-body\">\n                                            <p>Yes, Migration and Registration are two different processes under GST. And this Migration is the first step in the GST Registration.</p>\n                                                 \n                                        </div>\n                                    </div>\n                                </div>\n  \n                                <div class=\"panel panel-default\">\n                                    <div class=\"panel-heading\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-2\">Who is required to Migrate or Enroll under GST ?</a>\n                                    </div>\n                                    <div id=\"collapse-2\" class=\"panel-collapse collapse\">\n                                        <div class=\"panel-body\">\n                                            <p>If you are the existing dealer under VAT, then you need to migrate/enroll under the GST.</p>\n                                        </div>\n                                    </div>\n                                </div>\n  \n                                <div class=\"panel panel-default\">\n                                    <div class=\"panel-heading\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-3\"> Does GST Migration/Enrollment is mandatory for the Taxpayers ?</a>\n                                    </div>\n                                    <div id=\"collapse-3\" class=\"panel-collapse collapse\">\n                                        <div class=\"panel-body\">\n                                            <p>Yes, Migration to GST is mandatory for the taxpayers under the GST Law. </p>\n                                        </div>\n                                    </div>\n                                </div>\n  \n                                <div class=\"panel panel-default\">\n                                      <div class=\"panel-heading\">\n                                          <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-4\">What happens if I do not update my GSTIN ?</a>\n                                      </div>\n                                      <div id=\"collapse-4\" class=\"panel-collapse collapse\">\n                                          <div class=\"panel-body\">\n                                              <p>One should update the GST IN or else you will be not able to take advantage of credits on the tax we collect.</p>\n                                          </div>\n                                      </div>\n                                  </div>\n  \n                                  <div class=\"panel panel-default\">\n                                          <div class=\"panel-heading\">\n                                              <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-5\">Is there is a fee for enrolling in the GST system portal ?</a>\n                                          </div>\n                                          <div id=\"collapse-5\" class=\"panel-collapse collapse\">\n                                              <div class=\"panel-body\">\n                                                  <p>No there is no fee or charge levied on the taxpayer for the enrollment on the GST System portal.</p>\n                                              </div>\n                                          </div>\n                                      </div>\n                            </div>\n                        </div> <!-- end faq -->\n                    </div> <!-- end discusssion-faq -->\n                </div> <!-- end service-single-content -->\n            </div> <!-- end col -->\n            <div class=\"col col-md-4 col-md-pull-8\">\n                <div class=\"service-sidebar\">\n                    <div class=\"widget link-widget\">\n                        <ul>\n                            <li><a [routerLink]=\"['/services']\" >All Services</a></li>\n                            <li ><a [routerLink]=\"['/GST-Registration']\">GST Registration </a></li>\n                            <li><a [routerLink]=\"['/GST-Retrurn-Filling']\">GST Return Filing</a></li>\n                            <li class=\"active\"><a [routerLink]=\"['/GST-Migration']\">GST Migration</a></li>\n                            <li><a [routerLink]=\"['/GST-Software']\">GST Software And Tool</a></li>\n                            <li><a [routerLink]=\"['/GST-Assessment']\">GST Assessment</a></li>\n                            <li><a [routerLink]=\"['/GST-Service-Provider']\">GSP And ASP Service Provider</a></li>\n                        </ul>\n                    </div>\n                   \n                    <div class=\"widget brochures-widget\">\n                        <h3>Brochures</h3>\n                        <p>View our 2017 financial prospectus brochure for an easy to read guide on all of the services offer.</p>\n                        <div class=\"btns\">\n                            <a href=\"#\"><i class=\"fa fa-download\"></i> Download Brochure</a>\n                     </div>\n                    </div>\n\n                    <div class=\"widget contact-widget\">\n                        <h3>Contact</h3>\n                        <ul>\n                            <li><i class=\"fa fa-location-arrow\"></i> 3111 West Allegheny Avenue Pennsylvania 19132</li>\n                            <li><i class=\"fa fa-phone\"></i> 1-982-782-5297 <br>1-982-125-6378</li>\n                            <li><i class=\"fa fa-envelope\"></i> support@top-finance.com</li>\n                        </ul>\n                    </div>\n                </div>\n            </div>\n        </div> <!-- end row -->\n    </div> <!-- end container -->\n  </section>\n  <!-- end service-single-section -->\n  \n  \n  "

