module.exports = " <!-- start page-title -->\n <section class=\"page-title\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col col-xs-12\">\n                <h2>Privacy Policy</h2>\n                <ol class=\"breadcrumb\">\n                    <li><a [routerLink]=\"['/']\">Home</a></li>\n                    <li>Privacy Policy</li>\n                </ol>\n            </div>\n        </div> <!-- end row -->\n    </div> <!-- end container -->\n  </section>        \n  <!-- end page-title -->\n  \n  \n  <!-- start service-single-section -->\n  <section class=\"service-single-section section-padding\">\n    <div class=\"container\">\n        <div class=\"row\">\n               <div class=\"service-single-content\">\n                    <div class=\"discussion-faq\">\n                        <div class=\"faq\">\n                            <div class=\"panel-group\" id=\"accordion\">\n                                <div class=\"panel panel-default\">\n                                    <div class=\"panel-heading\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-1\" > Gstgola Privacy Policy</a>\n                                    </div>\n                                    <div id=\"collapse-1\" class=\"panel-collapse collapse \">\n                                        <div class=\"panel-body\">\n                                          <div class=\"discussion\">\n                                            <ul>\n                                              <li><i class=\"fa fa-adjust\"></i>We Gstgola will value for your privacy and you can visit our website without providing any information to us. And in case sometimes we need some information about you. Our web servers collect the domain names of a particular visitor for measuring the average time spent on the website, no.of page views, and etc. Gstgola does not share any kind of information about you except in the case of the products and services which you have requested or when we have the permissions from you.</li>\n                                              <li><i class=\"fa fa-adjust\"></i>Gstgola will give you the importance of protection and respect the privacy of the clients or customers. We make our clients feel comfortable while using the products and services. The Gstgola is committed to protect your privacy and entrust your personal tax return information.</li>\n                                            </ul>\n\n\n                                          </div>\n                                           \n                                        </div>\n                                    </div>\n                                </div>\n  \n                                <div class=\"panel panel-default\">\n                                    <div class=\"panel-heading\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-2\">Object of Policy</a>\n                                    </div>\n                                    <div id=\"collapse-2\" class=\"panel-collapse collapse\">\n                                        <div class=\"panel-body\">\n                                           <p>For preventing the unauthorized access to the website, maintain the data accuracy to ensure the relevant use of information. Gstgola utilizes the technical and administrative process to protect the information that we collect.</p>\n                                        </div>\n                                    </div>\n                                </div>\n  \n                                <div class=\"panel panel-default\">\n                                    <div class=\"panel-heading\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-3\"> Collection of Information </a>\n                                    </div>\n                                    <div id=\"collapse-3\" class=\"panel-collapse collapse\">\n                                        <div class=\"panel-body\">\n                                           <p>Whenever the users look for the product or service from Gstgola we ask for the data such as name, address, and mobile number. This information is useful for maintenance of the Gstgola account information. And as well as we collect the data about your income, credits, dependents for providing the audit defense service. </p>\n                                        </div>\n                                    </div>\n                                </div>\n\n                                <div class=\"panel panel-default\">\n                                    <div class=\"panel-heading\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-4\"> Information Security </a>\n                                    </div>\n                                    <div id=\"collapse-4\" class=\"panel-collapse collapse\">\n                                        <div class=\"panel-body\">\n                                        <p>We often protect the personal as well as the tax return information using the security safeguards and also maintains the electronic safeguards for all the tax return information. </p>\n                                                                              </div>\n                                    </div>\n                                </div>\n\n                                <div class=\"panel panel-default\">\n                                    <div class=\"panel-heading\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-5\"> Non-Personal Identification Information </a>\n                                    </div>\n                                    <div id=\"collapse-5\" class=\"panel-collapse collapse\">\n                                        <div class=\"panel-body\">\n                                            <p>We collect the non-personal identification information about the users when the users interact with our website. This non-personal information includes the browser name, type of the computer, technical information about the users. And the other information such as operating systems as well as the internet service providers that are utilized.\n                                              </p>\n                                        </div>\n                                    </div>\n                                </div>\n\n                                <div class=\"panel panel-default\">\n                                        <div class=\"panel-heading\">\n                                            <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-6\" > Changes to Privacy Policy</a>\n                                        </div>\n                                        <div id=\"collapse-6\" class=\"panel-collapse collapse\">\n                                            <div class=\"panel-body\">\n                                                  <p>It is important to note that all the above-mentioned privacy policy changes from time to time and we update our policies on this page if we think that they are more significant.  </p>                                               \n                                            </div>\n                                        </div>\n                                    </div>\n  \n                            </div>\n                        </div> <!-- end faq -->\n                    </div> <!-- end discusssion-faq -->\n                </div> <!-- end service-single-content -->\n          \n        \n        </div> <!-- end row -->\n    </div> <!-- end container -->\n  </section>\n  <!-- end service-single-section -->\n  \n  \n  "

