module.exports = " <!-- start page-title -->\n <section class=\"page-title\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col col-xs-12\">\n                <h2>GST Return Filling</h2>\n                <ol class=\"breadcrumb\">\n                    <li><a [routerLink]=\"['/']\">Home</a></li>\n                    <li>GST Return Filling</li>\n                </ol>\n            </div>\n        </div> <!-- end row -->\n    </div> <!-- end container -->\n  </section>        \n  <!-- end page-title -->\n  \n  \n  <!-- start service-single-section -->\n  <section class=\"service-single-section section-padding\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col col-md-8 col-md-push-4\">\n                <div class=\"service-single-content\">\n                    <h4>Who Have to File GST Returns?</h4>\n                    <p>Business owners who have completed their GST registration have to return the GST files according to their business.</p>                   \n                   \n                    <div class=\"discussion-v\">\n                            <div class=\"discussion\">\n                                <h4>GST Return Filing Advantages</h4>\n                                <ul>\n                                        <li><i class=\"fa fa-adjust\"></i><strong>Unified Platform:</strong>By implementing GST, all the indirect taxes are standardized. Business owners no need to maintain multiple VAT registrations under GST in different states. Single GST registration is enough for sale and purchase goods across India.</li>\n                                        <li><i class=\"fa fa-adjust\"></i><strong>Subsuming of Taxes: </strong>Central Sales Tax, Luxury Tax, Purchase Tax, etc. comes under subsuming taxes. But now, all the taxes are subsumed and made into single tax under GST.</li>\n                                        <li><i class=\"fa fa-adjust\"></i><strong>Ease of Doing Business: </strong>Many businesses have to comply with VAT as well as Service Tax regulations which create the compliance burden on business. But under GST, all the variations are gone between the goods and services.</li>\n                                        <li><i class=\"fa fa-adjust\"></i><strong>Lower taxes: </strong>In some states, businesses have to comply with VAT when they cross their annual turnover of Rs. 5 lakhs. Buts GST liability accrues when they cross an annual turnover of Rs. 20 lakhs in India and Rs. 10 lakhs in the northeast.</li>\n                             </ul>\n                                </div>\n                                </div>\n                 \n                    <div class=\"img-holder\">\n                                <img src=\"assets/images/1.png\" alt=\"\">     \n                    </div>\n                    <br>\n                    <p>GST return is a document which consists all the information of taxpayers sales, purchase, tax paid for your purchases (input tax), and collect tax on sales (output tax). GstGola is the leading GST service provider in India from GST registration to return filing. </p>\n\n                    <div class=\"discussion-faq\">\n                        <div class=\"discussion\">\n                            <h4>How to File GST Returns ?</h4>\n                            <ul>\n                                    <li><i class=\"fa fa-adjust\"></i><strong>GSTR - 1: </strong>Monthly Details of outward supplies of GST. Taxpayers have to file the GST Return by the 10th of every following month.</li>\n                                    <li><i class=\"fa fa-adjust\"></i><strong>GSTR - 2: </strong>Monthly Details of inward supplies and it has to be filed the GST Return by 15th of every following month.</li>\n                                     <li><i class=\"fa fa-adjust\"></i><strong>GSTR - 3: </strong>Monthly GST Return file with the payment of Tax and it has to be filed by on or before 20th of next month.</li>\n                                     <li><i class=\"fa fa-adjust\"></i><strong>GSTR - 9: </strong>Annual GST Return Filing which has to be paid by 31st of December of every financial year.</li>\n                               \n                               \n                            </ul>\n                        </div>\n  \n                        <div class=\"faq\">\n                            <div class=\"panel-group\" id=\"accordion\">\n                                <div class=\"panel panel-default\">\n                                    <div class=\"panel-heading\">\n                                        <a data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-1\" aria-expanded=\"true\"> Who does GST Return Filing ? </a>\n                                    </div>\n                                    <div id=\"collapse-1\" class=\"panel-collapse collapse in\">\n                                        <div class=\"panel-body\">\n                                            <p>Business owners who have registered under GST have to return the GST files according to their business. Even Nil GST return has to be filed under GST return.</p>\n                                                  \n                                        </div>\n                                    </div>\n                                </div>\n  \n                                <div class=\"panel panel-default\">\n                                    <div class=\"panel-heading\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-2\">What happens if the GST return is not filed on time ?</a>\n                                    </div>\n                                    <div id=\"collapse-2\" class=\"panel-collapse collapse\">\n                                        <div class=\"panel-body\">\n                                            <p>If the taxpayer has not filed their GST return within the due date, the taxpayer has to pay the late fee of Rs. 100 per day up to Rs. 5000.</p>\n                                        </div>\n                                    </div>\n                                </div>\n  \n                                <div class=\"panel panel-default\">\n                                    <div class=\"panel-heading\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-3\">What is the Periodicity of GST Filing Return ?</a>\n                                    </div>\n                                    <div id=\"collapse-3\" class=\"panel-collapse collapse\">\n                                        <div class=\"panel-body\">\n                                            <p>Periodicity has specified based on the type of registration and transactions. Foreign Non-Residents, Tax Deductors, and E-commerce Operators, Input Service Distributor, Regular taxpayers have to file the monthly GST returns.</p>\n                                        </div>\n                                    </div>\n                                </div>\n  \n                                <div class=\"panel panel-default\">\n                                      <div class=\"panel-heading\">\n                                          <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-4\">Can I pay the due taxes after filing the GST Return ?</a>\n                                      </div>\n                                      <div id=\"collapse-4\" class=\"panel-collapse collapse\">\n                                          <div class=\"panel-body\">\n                                              <p>No, the returns will be invalid if the taxpayer has not paid the tax before filing the GST return.</p>\n                                          </div>\n                                      </div>\n                                  </div>\n  \n                                  <div class=\"panel panel-default\">\n                                          <div class=\"panel-heading\">\n                                              <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-5\">What type of GST returns need to be filed when a registered business terminates its operations permanently ?</a>\n                                          </div>\n                                          <div id=\"collapse-5\" class=\"panel-collapse collapse\">\n                                              <div class=\"panel-body\">\n                                                  <p>If any business terminates permanently, all the operations of that business need to file the GSTR-10 which is also known as Final GST Return.</p>\n                                              </div>\n                                          </div>\n                                      </div>\n                            </div>\n                        </div> <!-- end faq -->\n                    </div> <!-- end discusssion-faq -->\n                </div> <!-- end service-single-content -->\n            </div> <!-- end col -->\n            <div class=\"col col-md-4 col-md-pull-8\">\n                <div class=\"service-sidebar\">\n                    <div class=\"widget link-widget\">\n                        <ul>\n                            <li><a [routerLink]=\"['/services']\" >All Services</a></li>\n                            <li ><a [routerLink]=\"['/GST-Registration']\">GST Registration </a></li>\n                            <li class=\"active\"><a [routerLink]=\"['/GST-Retrurn-Filling']\">GST Return Filing</a></li>\n                            <li><a [routerLink]=\"['/GST-Migration']\">GST Migration</a></li>\n                            <li><a [routerLink]=\"['/GST-Software']\">GST Software And Tool</a></li>\n                            <li><a [routerLink]=\"['/GST-Assessment']\">GST Assessment</a></li>\n                            <li><a [routerLink]=\"['/GST-Service-Provider']\">GSP And ASP Service Provider</a></li>\n                        </ul>\n                    </div>\n                   \n                    <div class=\"widget brochures-widget\">\n                        <h3>Brochures</h3>\n                        <p>View our 2017 financial prospectus brochure for an easy to read guide on all of the services offer.</p>\n                        <div class=\"btns\">\n                            <a href=\"#\"><i class=\"fa fa-download\"></i> Download Brochure</a>\n                     </div>\n                    </div>\n\n                    <div class=\"widget contact-widget\">\n                        <h3>Contact</h3>\n                        <ul>\n                            <li><i class=\"fa fa-location-arrow\"></i> 3111 West Allegheny Avenue Pennsylvania 19132</li>\n                            <li><i class=\"fa fa-phone\"></i> 1-982-782-5297 <br>1-982-125-6378</li>\n                            <li><i class=\"fa fa-envelope\"></i> support@top-finance.com</li>\n                        </ul>\n                    </div>\n                </div>\n            </div>\n        </div> <!-- end row -->\n    </div> <!-- end container -->\n  </section>\n  <!-- end service-single-section -->\n  \n  \n  "

