module.exports = " <!-- start page-title -->\n <section class=\"page-title\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col col-xs-12\">\n                <h2>GSP and ASP Service Provider</h2>\n                <ol class=\"breadcrumb\">\n                    <li><a [routerLink]=\"['/']\">Home</a></li>\n                    <li>GSP and ASP Service Provider</li>\n                </ol>\n            </div>\n        </div> <!-- end row -->\n    </div> <!-- end container -->\n  </section>        \n  <!-- end page-title -->\n  \n  \n  <!-- start service-single-section -->\n  <section class=\"service-single-section section-padding\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col col-md-8 col-md-push-4\">\n                <div class=\"service-single-content\">\n                  <h4>Role of GSP And ASP</h4>\n                  <p>GSTN introduced the GSPs (Goods and Service Tax Suvidha Provider) which is a unique concept used to cover over the millions of users or taxpayers for performing all the functionalities easily. ASP (Application Service Provider) focuses on all the information of taxpayer’s sales and purchases and converts them into GST returns. </p>\n                  <div class=\"img-holder\">\n                            <img src=\"assets/images/gspasp.PNG\" alt=\"\">     \n                        </div>\n                    <br>\n                    <p>With the help of the GSP and ASP services, Users or Taxpayers can file their returns. Taxpayers have to pay some money for filing returns under GSP and ASP. Taxpayers or users can file their returns under GSP and ASP easily without the knowledge of taxation and Taxpayer have just to fill the essential details, and it automatically calculates the returns and submits to the GST portal. GSP and ASP save the time and money for the taxpayers. </p>  \n\n                    <p>GSP and ASP are treated as a third-party application that offers the convenient method to the taxpayers to interact with the GST systems, uploading invoice details, from registration to filing returns. </p>\n                 \n  \n  \n                    <div class=\"discussion-faq\">\n                        <div class=\"discussion\">\n                              <h4>Things to Remember while Choosing GSP/ ASP</h4>\n                              <ul>\n                          <li><i class=\"fa fa-adjust\"></i> <strong> Data Protection and Privacy:</strong> Make sure that the GSP/ ASP can maintain the data security strengths, data privacy, and the arrangement of ASP to protect the shared data. </li>\n\n                          <li><i class=\"fa fa-adjust\"></i>  <strong>Value Added Services:</strong> Check whether it is providing Value Added Services like tax alerts, trend analysis, and legal support.</li>\n                          <li><i class=\"fa fa-adjust\"></i>  <strong>Data Retrieval & Audit Trail:</strong> It is important to check the data retrieval which is used to record preservation of the taxpayer.</li>\n                         \n\n                        </ul>\n                        </div>\n  \n                        <div class=\"faq\">\n                            <div class=\"panel-group\" id=\"accordion\">\n                                <div class=\"panel panel-default\">\n                                    <div class=\"panel-heading\">\n                                        <a data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-1\" aria-expanded=\"true\"> What are GSPs and how do they help with GST ?</a>\n                                    </div>\n                                    <div id=\"collapse-1\" class=\"panel-collapse collapse in\">\n                                        <div class=\"panel-body\">\n                                                <p>GSPs or GSP providers are authorized by the GSTN (Goods and Service Tax Network). GSPs encourage the people to upload the GST returns safely in the prescribed format. </p>                                                 \n                                        </div>\n                                    </div>\n                                </div>\n  \n                                <div class=\"panel panel-default\">\n                                    <div class=\"panel-heading\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-2\">What will be their role ASPs and who are they ?</a>\n                                    </div>\n                                    <div id=\"collapse-2\" class=\"panel-collapse collapse\">\n                                        <div class=\"panel-body\">\n                                            <p>ASP defined as Application Service Providers. ASP is very helpful for the taxpayers to plan the GST returns as monthly and yearly wise. It enables the reconciliation of returns appropriately and timely credits.</p>\n                                        </div>\n                                    </div>\n                                </div>\n  \n                                <div class=\"panel panel-default\">\n                                    <div class=\"panel-heading\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-3\"> Why do you need GSP Services ?</a>\n                                    </div>\n                                    <div id=\"collapse-3\" class=\"panel-collapse collapse\">\n                                        <div class=\"panel-body\">\n                                         <div class=\"discussion faq-list\">\n                                                    <ul>\n                                                    <li><i class=\"fa fa-adjust\"></i> Uploading of Invoice on GSTN</li>\n                                                    <li><i class=\"fa fa-adjust\"></i> Downloading of data of inward supplies</li>\n                                                    <li><i class=\"fa fa-adjust\"></i> Reconciliation of Input Tax Credit</li>\n                                                    <li><i class=\"fa fa-adjust\"></i> Accessing GST Ledgers</li>\n                                                    <li><i class=\"fa fa-adjust\"></i> Uploading of GST Returns</li>\n\n                                                </ul>\n                                            </div>\n                                        \n                                        </div>\n                                    </div>\n                                </div>\n  \n                                 <div class=\"panel panel-default\">\n                                      <div class=\"panel-heading\">\n                                          <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-4\">Will GSPs have the commercial arrangement of Goods and Service Tax Network ?</a>\n                                      </div>\n                                      <div id=\"collapse-4\" class=\"panel-collapse collapse\">\n                                          <div class=\"panel-body\">\n                                                <div class=\"discussion faq-list\">\n                                                        <ul>\n                                                        <li><i class=\"fa fa-adjust\"></i> GSPs have to confirm to Goods and Service Tax integration requirements as well as the technical interface of the system.</li>\n                                                        <li><i class=\"fa fa-adjust\"></i> The GSTN agreement includes an arrangement to be signed with the GSPs and GSTN</li>\n                                                        \n                                                    </ul>\n                                                </div>\n                                          </div>\n                                      </div>\n                                  </div>\n  \n                                  <div class=\"panel panel-default\">\n                                          <div class=\"panel-heading\">\n                                              <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-5\">Can GSPs determine the billing plan independently ?</a>\n                                          </div>\n                                          <div id=\"collapse-5\" class=\"panel-collapse collapse\">\n                                              <div class=\"panel-body\">\n                                                  <p>Yes. Goods and Service Tax Network do not have any restrictions. </p>\n                                              </div>\n                                          </div>\n                                      </div> \n                            </div>\n                        </div> <!-- end faq -->\n                    </div> <!-- end discusssion-faq -->\n                </div> <!-- end service-single-content -->\n            </div> <!-- end col -->\n            <div class=\"col col-md-4 col-md-pull-8\">\n                <div class=\"service-sidebar\">\n                    <div class=\"widget link-widget\">\n                        <ul>\n                            <li><a [routerLink]=\"['/services']\" >All Services</a></li>\n                            <li ><a [routerLink]=\"['/GST-Registration']\">GST Registration </a></li>\n                            <li><a [routerLink]=\"['/GST-Retrurn-Filling']\">GST Return Filing</a></li>\n                            <li ><a [routerLink]=\"['/GST-Migration']\">GST Migration</a></li>\n                            <li ><a [routerLink]=\"['/GST-Software']\">GST Software And Tool</a></li>\n                            <li><a [routerLink]=\"['/GST-Assessment']\">GST Assessment</a></li>\n                            <li class=\"active\"><a [routerLink]=\"['/GST-Service-Provider']\">GSP And ASP Service Provider</a></li>\n                        </ul>\n                    </div>\n                  \n                    <div class=\"widget brochures-widget\">\n                        <h3>Brochures</h3>\n                        <p>View our 2017 financial prospectus brochure for an easy to read guide on all of the services offer.</p>\n                        <div class=\"btns\">\n                            <a href=\"#\"><i class=\"fa fa-download\"></i> Download Brochure</a>\n                     </div>\n                    </div>\n\n                    <div class=\"widget contact-widget\">\n                        <h3>Contact</h3>\n                        <ul>\n                            <li><i class=\"fa fa-location-arrow\"></i> 3111 West Allegheny Avenue Pennsylvania 19132</li>\n                            <li><i class=\"fa fa-phone\"></i> 1-982-782-5297 <br>1-982-125-6378</li>\n                            <li><i class=\"fa fa-envelope\"></i> support@top-finance.com</li>\n                        </ul>\n                    </div>\n                </div>\n            </div>\n        </div> <!-- end row -->\n    </div> <!-- end container -->\n  </section>\n  <!-- end service-single-section -->\n  \n  \n  "

