module.exports = " <!-- start page-title -->\n <section class=\"page-title\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col col-xs-12\">\n                <h2>GST Software And Tool</h2>\n                <ol class=\"breadcrumb\">\n                    <li><a [routerLink]=\"['/']\">Home</a></li>\n                    <li>GST Software And Tool</li>\n                </ol>\n            </div>\n        </div> <!-- end row -->\n    </div> <!-- end container -->\n  </section>        \n  <!-- end page-title -->\n  \n  \n  <!-- start service-single-section -->\n  <section class=\"service-single-section section-padding\">\n    <div class=\"container\">\n        <div class=\"row\">\n            <div class=\"col col-md-8 col-md-push-4\">\n                <div class=\"service-single-content\">\n                  <h4>GST Accounting Software</h4>\n                  <p> Are you looking for the best GST Accounting Software in India? Then you are on a right path where GstGola lets you have a clear idea of GST Accounting Softwares. We provide the top rated and best GST software for accounting and as well as for Filing. As of now lets us go deep into the GST Accounting Software.</p>\n                  <p>GST Accounting Software supports both accounting and as well as filing returns. These are required for the business to manage accounting and finance. And generally, these are used by the bookkeepers and accountants for the daily business. </p>\n                   <p>Our GstGola is providing the best accounting software to its clients so that the users will have a clear awareness of the accounts. Choosing the best GST software is very important as we can not change the software every time. The best accounting software helps to save the time and money with the GST obeying laws. Importantly the GstGola is known for its friendly support with an easy interface among all the software that are available in the market. Free Download GST software from our GstGola. \n                    </p>\n                    <div class=\"img-holder\">\n                            <img src=\"assets/images/software.jpg\" alt=\"\">     \n                        </div>\n                    <br>\n                 \n  \n                    <div class=\"discussion-v\">\n                          <div class=\"discussion\">\n                    <h4>Find out the Best GST Software</h4>\n<p>Every firm or organization has its expectations, aims, and rules for any accounting software. We need to consider the following things while choosing the best GST Accounting Software. </p>                    <ul>\n                        <li><i class=\"fa fa-adjust\"></i> We need to check whether the software has all the requirements related to payroll.</li>\n                        <li><i class=\"fa fa-adjust\"></i> Also ensure that the system tracks are available in stock, and are in progress, and other tasks, etc.</li>\n                        <li><i class=\"fa fa-adjust\"></i> Planning to handle multiple accounts.</li>\n                        <li><i class=\"fa fa-adjust\"></i> Check out whether it can handle the foreign exchange.</li>\n                        <li><i class=\"fa fa-adjust\"></i> Whether it provides the software for the online platform for the activities like online payments, verification of records, etc.</li>\n                        <li><i class=\"fa fa-adjust\"></i> Maintain records of sales, a tax charged on it, how much amount they purchase.</li>\n                      \n  \n  \n                    </ul>\n                    </div></div>\n  \n                    <div class=\"discussion-faq\">\n                        <div class=\"discussion\">\n                              <h4>Have a Glance at Features of GST Accounting Software</h4>\n<p>While using the GST Accounting Software, we should keep in mind that it should have certain features. Therefore have a look at these features as well.</p>                    <ul>\n                          <li><i class=\"fa fa-adjust\"></i>  The GST Accounting Software must generate the GST invoice, and we must customize the appearance and as per the business.</li>\n\n                          <li><i class=\"fa fa-adjust\"></i>  It has to manage the inventory, inward and outward stock movements.</li>\n                          <li><i class=\"fa fa-adjust\"></i>  Keeps a record of inventory purchase and as well as the purchase orders.</li>\n                          <li><i class=\"fa fa-adjust\"></i>  It has to create and manage the GST taxes like SGST, CGST, and IGST.</li>\n                          <li><i class=\"fa fa-adjust\"></i>  And it manages the customer's database and vendors.</li>\n\n                        </ul>\n                        </div>\n  \n                        <div class=\"faq\">\n                            <div class=\"panel-group\" id=\"accordion\">\n                                <div class=\"panel panel-default\">\n                                    <div class=\"panel-heading\">\n                                        <a data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-1\" aria-expanded=\"true\"> Is there are any area based exemption under GST ?</a>\n                                    </div>\n                                    <div id=\"collapse-1\" class=\"panel-collapse collapse in\">\n                                        <div class=\"panel-body\">\n                                                <p>No there won’t be any area based exemptions in GST.</p>                                                 \n                                        </div>\n                                    </div>\n                                </div>\n  \n                                <div class=\"panel panel-default\">\n                                    <div class=\"panel-heading\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-2\">Can one State GST can be used to pay for other State GST ?</a>\n                                    </div>\n                                    <div id=\"collapse-2\" class=\"panel-collapse collapse\">\n                                        <div class=\"panel-body\">\n                                            <p>The CGST and the SGST can be used for the payment of a particular CGST or SGST within the state only for the same GSTIN.</p>\n                                        </div>\n                                    </div>\n                                </div>\n  \n                                <div class=\"panel panel-default\">\n                                    <div class=\"panel-heading\">\n                                        <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-3\"> Does it requires separate registration  manufacturing and trading ?</a>\n                                    </div>\n                                    <div id=\"collapse-3\" class=\"panel-collapse collapse\">\n                                        <div class=\"panel-body\">\n                                            <p>No, it requires only one registration per State for the activities. </p>\n                                        </div>\n                                    </div>\n                                </div>\n  \n                              <!--   <div class=\"panel panel-default\">\n                                      <div class=\"panel-heading\">\n                                          <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-4\">What happens if I do not update my GSTIN.?</a>\n                                      </div>\n                                      <div id=\"collapse-4\" class=\"panel-collapse collapse\">\n                                          <div class=\"panel-body\">\n                                              <p>One should update the GST IN or else you will be not able to take advantage of credits on the tax we collect.</p>\n                                          </div>\n                                      </div>\n                                  </div>\n  \n                                  <div class=\"panel panel-default\">\n                                          <div class=\"panel-heading\">\n                                              <a class=\"collapsed\" data-toggle=\"collapse\" data-parent=\"#accordion\" href=\"#collapse-5\">Is there is a fee for enrolling in the GST system portal.?</a>\n                                          </div>\n                                          <div id=\"collapse-5\" class=\"panel-collapse collapse\">\n                                              <div class=\"panel-body\">\n                                                  <p>No there is no fee or charge levied on the taxpayer for the enrollment on the GST System portal.</p>\n                                              </div>\n                                          </div>\n                                      </div> -->\n                            </div>\n                        </div> <!-- end faq -->\n                    </div> <!-- end discusssion-faq -->\n                </div> <!-- end service-single-content -->\n            </div> <!-- end col -->\n            <div class=\"col col-md-4 col-md-pull-8\">\n                <div class=\"service-sidebar\">\n                    <div class=\"widget link-widget\">\n                        <ul>\n                            <li><a [routerLink]=\"['/services']\" >All Services</a></li>\n                            <li ><a [routerLink]=\"['/GST-Registration']\">GST Registration </a></li>\n                            <li><a [routerLink]=\"['/GST-Retrurn-Filling']\">GST Return Filing</a></li>\n                            <li ><a [routerLink]=\"['/GST-Migration']\">GST Migration</a></li>\n                            <li class=\"active\"><a [routerLink]=\"['/GST-Software']\">GST Software And Tool</a></li>\n                            <li><a [routerLink]=\"['/GST-Assessment']\">GST Assessment</a></li>\n                            <li><a [routerLink]=\"['/GST-Service-Provider']\">GSP And ASP Service Provider</a></li>\n                        </ul>\n                    </div>\n                    \n                    <div class=\"widget brochures-widget\">\n                        <h3>Brochures</h3>\n                        <p>View our 2017 financial prospectus brochure for an easy to read guide on all of the services offer.</p>\n                        <div class=\"btns\">\n                            <a href=\"#\"><i class=\"fa fa-download\"></i> Download Brochure</a>\n                     </div>\n                    </div>\n\n                    <div class=\"widget contact-widget\">\n                        <h3>Contact</h3>\n                        <ul>\n                            <li><i class=\"fa fa-location-arrow\"></i> 3111 West Allegheny Avenue Pennsylvania 19132</li>\n                            <li><i class=\"fa fa-phone\"></i> 1-982-782-5297 <br>1-982-125-6378</li>\n                            <li><i class=\"fa fa-envelope\"></i> support@top-finance.com</li>\n                        </ul>\n                    </div>\n                </div>\n            </div>\n        </div> <!-- end row -->\n    </div> <!-- end container -->\n  </section>\n  <!-- end service-single-section -->\n  \n  \n  "

